import React, { useEffect,useReducer } from "react";
import { reducer } from "./reducer";
import Cards from "./Cards";
import {getsReq} from './useFetch'
import {
  Route,
  Link
} from "react-router-dom";

function FetchingData() {
  const [data, dispatch] = useReducer(reducer, []);


useEffect(() => {
  getsReq().then(result => dispatch({type:'GETS_DATA', payload: result}))
},[])



  return (
    <div className='container'>
    <div className="row">
        <Link to="/sellerForm">Selling</Link>
        <Link to='/watchList'>Watch List</Link>
      <h1 className="text-center">Online shop</h1>
      {data.map((event) => {
        return <Cards key={event._id} card={event} data={data} setData={ dispatch}/>;
      })}
      </div>
      </div>
  );
}

export default FetchingData;
